import{_ as a}from"./chunks/index.VAya1KE4.js";import{c,o,G as e,k as t}from"./chunks/framework.BFEalnvt.js";import"./chunks/theme.B1I7hsVa.js";import"./chunks/getArrayRandomItem.LhrzGfRF.js";const l=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"params":{"pkg":65,"idList":[1158,1109,996,997,950,916,840,801,759,680,634,317,65,378,73,316,318,150,758,493,485,80,371,158,227,379,179,147],"data":{"id":65,"name":"莱卡恩","summary":"冯·莱卡恩","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/05/25/76099754/66038988b3920216f826555eb31ec7d3_1374786350678823683.png","avatar":{"m":"https://act-upload.mihoyo.com/nap-obc-indep/2024/12/30/76099754/1997fd937595551b6199bfa549ca2f6e_7725552092054402894.png","pc":"https://act-upload.mihoyo.com/nap-obc-indep/2024/06/25/76099754/a2f0f3a5d589fb64192b8300737e04d1_8233581365025181282.png"},"attrs":[["稀有度","S"],["属性","冰"],["特性","击破"],["阵营","维多利亚家政"]],"destiny":[["LEVEL1满月蓄势","[强化特殊技]命中敌人时，招式造成的失衡值提升12%，8秒内最多触发一次；在[[强化特殊技]中完成蓄力时，该增益效果额外提升10%。据记载，当狼人身处月夜的时候，其攻击性将有显著提升。「不要直视月亮。」"],["LEVEL2能量回馈","使敌人失衡或触发队友的[连携技]时，莱卡恩回复5点能量，1秒内最多触发一次。「对于犬科动物来说，当他们完成某些较难的任务后，大脑所产生的兴奋感会短暂地提升他们的精神能量。」「这时作为主人的你若是可以摸摸它们的头，以示鼓励，他们将为此感到非常开心…」——摘自《犬类动物不靠谱研究手册》"],["LEVEL3执事教养","[普通攻击]、[闪避]、[支援技]、[特殊技]、[连携技]技能等级+2他的举手投足总是充满从容，他的言谈举止让人如沐春风，执事的教养就是让一切都在掌握中。"],["LEVEL4保持风度","在[普通攻击]或[特殊技]的发动期间受到敌方攻击时，莱卡恩立刻获得等同于自身7.5%生命值上限的护盾，持续15秒，护盾持续期间抗打断等级提升，15秒内最多触发一次。「优秀的执事，在任何情况下都能保持风度。」"],["LEVEL5头狼本色","[普通攻击]、[闪避]、[支援技]、[特殊技]、[连携技]技能等级+2他的眼神暗藏野性，他的喉间滚动嚎音。不论现在的他如何优雅，礼服下的他依然凶猛。"],["LEVEL6冷酷猎手","蓄力攻击命中敌人时，莱卡恩对目标造成的伤害提升10%，最多叠加5层，持续12秒；同一招式内最多叠加1层效果，重复触发时刷新持续时间。「抱歉，即使如此，我也是不会手下留情的。」「毕竟，空洞可不是什么需要公平对决的地方。」"]],"skill":[{"title":"普通攻击：狩月舞步","desc":"点按发动：向前方进行至多五段的打击，造成物理伤害；长按可以进行蓄力，提升招式的威力，并造成冰属性伤害。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/15559334/1f485fe9fd541ac46eca0a193951ce18_8185148212690213973.gif"},{"title":"闪避：进退得体","desc":"点按发动：快速的冲刺闪避；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/15559334/1581a1a0ad9631edde1dfef4b2ef0b73_6033701770140537453.gif"},{"title":"冲刺攻击：保持清洁 ","desc":"闪避时，点按发动：向前方滑铲进行连续打击，造成物理伤害。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/15559334/a1c1f38dc065e58c5cdb6d01a7017987_6188067386893507768.gif"},{"title":"闪避反击：礼仪教导","desc":"触发[极限闪避]后，点按发动：对前方敌人发动打击，造成冰属性伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/15559334/1487fb1d336d60200a7317e2a0b118b1_1427982175616486745.gif"},{"title":"快速支援：狼群","desc":"当前操作中的角色被击飞时，点按发动：对前方敌人发动打击，造成冰属性伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/15559334/cea30dc3512af1477212a6b916ac9480_388601956193066793.gif"},{"title":"招架支援：狩猎干预","desc":"前场角色即将被攻击时，点按发动：招架敌人的攻击，累积大量失衡值；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/15559334/95459b4b1b16d3cdbebec14f90048181_1520817171321803704.gif"},{"title":"支援突击：复仇反扑","desc":"发动[招架支援]后，点按发动：在前方生成冰柱并对区域内的敌人发动打击，造成冰属性伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/15559334/a96efb69663b57527f487cdc8fd61ac4_475232486531569088.gif"},{"title":"特殊技：追猎时刻","desc":"点按发动：向前方进行连续打击，造成冰属性伤害；长按可以进行蓄力，提升招式的威力；招式发动期间抗打断等级提升。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/15559334/f557b5988ba4277956151ec0430ceee9_7832644881738787342.gif"},{"title":"强化特殊技：狂猎时刻","desc":"能量足够时，点按发动：向前方进行强力连续打击，造成大量冰属性伤害；长按可以进行蓄力，消耗能量并提升招式的威力；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/30/76099754/c541e99cd85b6ffd13d854c8e0af0820_8013048409962168132.gif"},{"title":"连携技：遵命","desc":"触发[连携技]时，选择对应角色发动：对前方小范围敌人发动强力连续打击，造成大量冰属性伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/15559334/c4db56951b29379dafac01d8eba2ffd1_4893013946789532448.gif"},{"title":"终结技：不辱使命","desc":"喧响等级达到[极]时，点按发动：对前方大范围敌人发动强力连续打击，造成大量冰属性伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/15559334/ced9b62820cb06b3877c10cc558814e7_5104828998769739757.gif"},{"title":"核心技","desc":"核心被动：金属狼足莱卡恩在[普通攻击]中完成蓄力时，招式造成的失衡值提升40%。（此处数据为初始数据）[强化特殊技]或[支援突击]命中敌人时，目标的冰属性伤害抗性降低25%，持续30秒。额外能力：优雅猎群队伍中存在与自身属性或阵营相同的角色时触发：莱卡恩攻击命中处于失衡状态下的敌人时，目标的失衡易伤倍率提升35%（全队只能触发一次）。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/07/03/110289248/7dcc4bfa838ab84a3cecd243b1a19409_530678006385753305.gif"}]},"favModalLocalKey":"vitepress_game_zzz_role_fav_modal","favLocalKey":"vitepress_game_zzz_role_fav"},"relativePath":"game/zzz/role/65.md","filePath":"game/zzz/role/[pkg].md"}'),i={name:"game/zzz/role/65.md"},_=Object.assign(i,{setup(d){return(p,n)=>(o(),c("div",null,[e(t(a))]))}});export{l as __pageData,_ as default};
